import './App.css';
import Post from "./Post"
import Header from "./Header"
import { BrowserRouter, Route, Routes } from "react-router-dom"

function App() {
  return (

      <Routes>
        <Route path="/" element={<main><Header />
            <Post />
            <Post />
            <Post />
          </main>} />
      </Routes>

  );
}

export default App;
